import React from 'react';
import './App.css';
import axios from 'axios'

class App extends React.Component {
constructor(){
    super()
      this.state = {
        data: []
      }
  }
  componentDidMount() {
  axios.get("http://localhost:5000/",
  {headers: {'Access-Control-Allow-Origin': '*',
             'Access-Control-Request-Method':'GET'}
  })
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }


  render() {
    return (
      <table>
      <tbody>{this.state.data.map(function(item, key) {

               return (
                  <tr key = {key}>
                      <td>{item.userId}</td>
                      <td>{item.id}</td>
                      <td>{item.title}</td>
                      <td>{item.body}</td>
                  </tr>
                )

             })}</tbody>
       </table>
    )
}
}
export default App;
